import React, { Component } from "react";

class Navbar extends Component {
  render() {
    console.log(this.props.onTotal);
    return (
      <nav className="navbar navbar-light bg-light">
        <a className="navbar-brand">Item Counter:</a>
      </nav>
    );
  }
}

export default Navbar;
